=Language: {{$json["Language"]}}
City: {{$json["City"]}}
Topic: {{$json["Topic"]}}
Primary Keyword: {{$json["Keyword"]}}

Write a 700–900 word blog post in the given Language, focused on the Topic for the specified City.
- Use the Primary Keyword naturally 3–5 times.
- Include H1/H2/H3 headings, short paragraphs, bullet lists where helpful.
- Add a concise intro, actionable tips, and a conclusion with a call to action for local buyers/sellers/relocators (as relevant).
- Avoid generic fluff; be specific to {{$json["City"]}}.
- Return ONLY Markdown (no extra JSON or commentary).
